import React from 'react'

export default function Settings() {

    // fetch('http://localhost:1337/api/action')
    //     .then(res => res.json())
    //     .then(data => console.log(data))
    //     .catch(error => console.log('ERROR'))

    var action = [
        {
          title: 'Fullmetal Alchemist: Brotherhood',
          images: 'https://cdn.myanimelist.net/images/anime/7/74317l.jpg?_gl=1*1icm7kf*_ga*NDEyMDgyMDc0LjE2NTAzNDE4MDQ.*_ga_26FEP9527K*MTY1Mzg1MDE1Ni42OC4xLjE2NTM4NTAxNzYuNDA.' 
        }
    ]


    async function fetchList() {
        try {
            const response = await fetch(`http://localhost:1337/api/action`, {
                method: 'GET'
            });
            const mylist = await response.json();
            return mylist;
        } catch (error) {
            console.error(error);
        }
    }

    async function getList() {
        const mylist = await fetchList();
        action = mylist
    }

    getList();

    return (
    <div>XD</div>
  )
}
